require'pry'

CAPS = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
DOWNS = CAPS.downcase
COMBOS = []

CAPS.split("").each_with_index do |a, index|
  COMBOS << "#{a}#{DOWNS[index]}"
  COMBOS << "#{DOWNS[index]}#{a}"
end

def incredible_shrinking_suit(inputs)
  activated_swatch = activate_polymer(inputs)
  activated_swatch.length
end

def activate_polymer(inputs)
  inputs_str = inputs
  if combos?(inputs_str.split(""))
    inputs_str = combo_hunter(inputs_str.split(""))
    activate_polymer(inputs_str)
  else
    inputs_str
  end
end

def combos?(inputs)
  inputs.each_with_index do |a, index|
    if COMBOS.include?("#{a}#{inputs[index+1]}")
      return true
    end
  end
  false
end

def combo_hunter(inputs)
  inputs_str = inputs
  inputs_str.each_with_index do |a, index|
    if COMBOS.include?("#{a}#{inputs[index+1]}")
      inputs_str.delete_at(index)
      inputs_str.delete_at(index)
    end
  end
  inputs_str.join("")
end

